import React from 'react';
import './App.css';
import {Route,Switch,Link} from 'react-router-dom';
import Home from './components/Home';
import CollectClinicals from './components/CollectClinicals';
import AddPatient from './components/AddPatient';
import AnalyzeData from './components/AnalyzeData';
import ChartGenerator from './components/ChartGenerator';
import 'bootstrap/dist/css/bootstrap.min.css';
import Login from "./components/login.component";
import Register from "./components/register.component";
import { Component } from 'react';
import AuthService from "./services/auth.service";

class App extends Component {

  constructor(props) {

    super(props);
    this.logOut = this.logOut.bind(this);

    this.state = {
      showDoctorBoard: false,
      showAdminBoard: false,
      currentUser: undefined,
    };
  }

  componentDidMount() {
    const user = AuthService.getCurrentUser();

    if (user) {
      this.setState({
        currentUser: user,
        showDoctorBoard: user.roles.includes("ROLE_DOCTOR"),
        showAdminBoard: user.roles.includes("ROLE_ADMIN"),
      });
    }
  }

  logOut() {
    AuthService.logout();
  }



  render() {
    const { currentUser, showModeratorBoard, showAdminBoard } = this.state;
    return (
      <div>
        <nav className="navbar navbar-expand navbar-dark bg-dark">
          <Link to={"/"} className="navbar-brand">
            NenadApp
          </Link>
          <div className="navbar-nav mr-auto">
            <li className="nav-item">
              <Link to={"/"} className="nav-link">

              </Link>
            </li>

            {showModeratorBoard && (
              <li className="nav-item">
                <Link to={"/"} className="nav-link">

                </Link>
              </li>
            )}

            {showAdminBoard && (
              <li className="nav-item">
                <Link to={"/"} className="nav-link">

                </Link>
              </li>
            )}

            {currentUser && (
              <li className="nav-item">
                <Link to={"/"} className="nav-link">

                </Link>
              </li>
            )}
          </div>

          {currentUser ? (
            <div className="navbar-nav ml-auto">
              <li className="nav-item">
                <Link to={"/"} className="nav-link">

                </Link>
              </li>
              <li className="nav-item">
                <a href="/login" className="nav-link" onClick={this.logOut}>
                  LogOut
                </a>
              </li>
            </div>
          ) : (
            <div className="navbar-nav ml-auto">
              <li className="nav-item">
                <Link to={"/login"} className="nav-link">
                  Login
                </Link>
              </li>

              <li className="nav-item">
                <Link to={"/register"} className="nav-link">
                  Sign Up
                </Link>
              </li>
            </div>
          )}
        </nav>

        <div className="container mt-3">
          <Switch>
          <Route exact path="/home" component={Home}/>
        <Route exact path="/login" component={Login}/>
        <Route exact path="/register" component={Register}/>
        <Route exact path="/patientDetails/:patientId" component={CollectClinicals}/>
        <Route exact path="/addPatient" component={AddPatient}/>
        <Route exact path="/analyze/:patientId" component={AnalyzeData}/>
        <Route exact path="/chart/:componentName/:patientId" component={ChartGenerator}/>
          </Switch>
        </div>
      </div>
    );
  }
}
export default App;
